import React, { Component } from 'react';
import {
  Grid,
  Row,
  Col,
} from 'react-bootstrap';
class Timeslots extends Component {
  render() {
    const text = 'Hi';
    return (

    <Grid>
      <Row className="show-grid">
        <Col xs={3} md={10}>
          {text}
        </Col>
        <Col xs={3} md={10}>
         {text}
        </Col>
        <Col xs={3} md={10}>
          {text}
        </Col>
      </Row>

       <Row className="show-grid">
        <Col xs={6} md={4}>
          {text}
        </Col>
        <Col xs={6} md={4}>
         {text}
        </Col>
        <Col xs={6} md={4}>
          {text}
        </Col>
      </Row>

       <Row className="show-grid">
        <Col xs={6} md={4}>
          {text}
        </Col>
        <Col xs={6} md={4}>
         {text}
        </Col>
        <Col xs={6} md={4}>
          {text}
        </Col>
      </Row>
    </Grid>
    );
  }
}

export default Timeslots;
